  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Nursing home summary information for
  the Health and Fire Safety Inspections currently listed on Nursing Home Compare,
  including dates of the three most recent inspections (including those with no deficiencies),
  and counts of deficiencies sited, overall and within the categories listed on Nursing
  Home Compare.  Data are presented as one inspection cycle per provider.  Note that
  deficiency counts do not include citations from complaint inspections.</p>n\",\n\t\"license_title\":
